import React from 'react';
import { useState } from 'react';
import Post from "../posts/post"

const postList = () => {
  const [posts, setPosts] = useState([])
  return (
    <div>
      {posts.map(post => {
        <Post post = {post} key = {post.id}/>
      })}
    </div>
  );
};

export default postList;
